import React from 'react'
import { withOGImage } from 'next-api-og-image'
/**
 * Social image generation via headless chrome.
 *
 * Note: To debug social images, set `debugInspectHtml` to true and load a social
 * image URL. Instead of returning the rendered image, it will return the raw HTML
 * that would've been passed to puppeteer. This makes it much easier to develop
 * and debug issues locally.
 */
const debugInspectHtml = false

const tailwindConfig = {
  darkMode: 'class',
  theme: {
    fontSize: {
      '2xs': ['0.75rem', { lineHeight: '1.25rem' }],
      xs: ['0.8125rem', { lineHeight: '1.5rem' }],
      sm: ['0.875rem', { lineHeight: '1.5rem' }],
      base: ['1rem', { lineHeight: '1.75rem' }],
      lg: ['1.125rem', { lineHeight: '1.75rem' }],
      xl: ['1.25rem', { lineHeight: '1.75rem' }],
      '2xl': ['1.5rem', { lineHeight: '2rem' }],
      '3xl': ['1.875rem', { lineHeight: '2.25rem' }],
      '4xl': ['2.25rem', { lineHeight: '2.5rem' }],
      '5xl': ['3rem', { lineHeight: '1' }],
      '6xl': ['3.75rem', { lineHeight: '1' }],
      '7xl': ['4.5rem', { lineHeight: '1' }],
      '8xl': ['6rem', { lineHeight: '1' }],
      '9xl': ['8rem', { lineHeight: '1' }],
    },
    extend: {
      maxWidth: {
        lg: '33rem',
        '2xl': '40rem',
        '3xl': '50rem',
        '5xl': '66rem',
      },
      opacity: {
        1: '0.01',
        2.5: '0.025',
        7.5: '0.075',
        15: '0.15',
      },
      colors: {
        // rgba(255, 205, 25)
        yellow: ({ opacityValue }) => {
          return `rgba(255, 205, 25, 1})`
        },
        // rgba(19, 20, 26)
        dark: ({ opacityValue }) => {
          return `rgba(19, 20, 26, 1})`
        },
        // rgba(248, 248, 252)
        light: ({ opacityValue }) => {
          return `rgba(248, 248, 252, 1})`
        },
        // rgba(36, 150, 129)
        green: ({ opacityValue }) => {
          return `rgba(36, 150, 129, 1})`
        },
        // rgba(151, 152, 171)
        grey: ({ opacityValue }) => {
          return `rgba(151, 152, 171, 1})`
        },
        // rgba(245, 107, 88)
        red: ({ opacityValue }) => {
          return `rgba(245, 107, 88, 1})`
        },
        // rgba(80, 79, 84)
        darkGrey: ({ opacityValue }) => {
          return `rgba(80, 79, 84, 1)`
        },
      },
    },
  },
};

export default withOGImage({
  template: {
    react: async ({ name, description }) => {
      return (
        <html className='dark'>
          <head>
            <meta charSet="UTF-8" />
            <meta name="viewport" content="width=device-width, initial-scale=1.0" />
            <script src="https://cdn.tailwindcss.com"></script>
            <style dangerouslySetInnerHTML={{ __html: style }} />
            <script dangerouslySetInnerHTML={{ __html: `tailwind.config = ${JSON.stringify(tailwindConfig)};` }}></script>
          </head>

          <body className='bcmsBody'>
            <div className='prose max-w-[80vw]'>
              <h1 className='text-4xl font-bold leading-6 tracking-tight text-zinc-800 dark:text-zinc-100 sm:text-5xl'>{name}</h1>
              {description && (<p className='mt-6 text-base text-zinc-600 dark:text-zinc-400'>{description}</p>)}
              <div className='flex gap-3 mt-6 mb-16 not-prose'>
                <a class="inline-flex gap-0.5 justify-center overflow-hidden text-sm font-medium transition rounded-full dark:bg-white py-1 px-3 text-light dark:bg-light/10 dark:text-black" href="/quickstart">Read the docs<svg viewBox="0 0 20 20" fill="none" aria-hidden="true" class="mt-0.5 h-5 w-5 -mr-1"><path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" d="m11.5 6.5 3 3.5m0 0-3 3.5m3-3.5h-9"></path></svg></a>
              </div>
            </div>
          </body>
        </html>
      )
    }
  },
  cacheControl: 'max-age=0, s-maxage=86400, stale-while-revalidate=3600',
  type: 'jpeg',
  quality: 75,
  dev: {
    inspectHtml: debugInspectHtml
  }
})

const style = `

:root {
  --shiki-color-text: theme('colors.light');
  --shiki-token-constant: #6ee7b7;
  --shiki-token-string: #6ee7b7;
  --shiki-token-comment: theme('colors.grey');
  --shiki-token-keyword: #7dd3fc;
  --shiki-token-parameter: #f9a8d4;
  --shiki-token-function: #c4b5fd;
  --shiki-token-string-expression: #6ee7b7;
  --shiki-token-punctuation: theme('colors.grey');
}

* {
  box-sizing: border-box;
}

.bcmsBody {
  position: relative;
  box-sizing: border-box;
  overflow-y: auto;
  overflow-x: hidden;
  --tw-bg-opacity: 1;
  background-color: rgba(252, 252, 252, 1);
  background-repeat: no-repeat;
  background-attachment: fixed;
  font-family: 'Inter', sans-serif;
  padding: 0;
  margin: 0;
  display: flex;
  align-items: center;
  justify-content: center;
}

.dark .bcmsBody {
  --tw-bg-opacity: 1;
  background-color: rgba(19, 20, 26, 1);
}

.bcmsBody {
  -webkit-overflow-scrolling: touch;
  background-image: url('data:image/png;base64,');
  background-position: 0 0;
  background-size: 450px;
}
@media screen and (min-width: 375px) {
  .bcmsBody {
    background-size: calc(327.14286px + 32.7619vw);
  }
}

@media screen and (min-width: 900px) {
  .bcmsBody {
    background-size: 622px;
  }
}
`
